text:
sushma somasekharan is the happy explorer. musically, and of it as well. we love her spirit of always looking around and beyond to discover and unravel possibilities in music and come together - sometimes with storytellers, sometimes with theatre actors, at other times with dancers - to communicate and enhance a narrative.  she is a friend and our go-to person for any project that requires a true spirit of collaboration. yesterday when she shared her #metoo story, she also became for us an explorer who is not afraid of #speakingup. sushma, our heart goes out to you but we hope your story will ensure that this ugly world full of predators becomes a safe place to be in, and soon! strength and hugs!

@sushmasaurus
