text:
@emileedupre had a little sunrise reflection time this morning.  working hard every day to be my best and mostly feeling deeply inspired.  but today woke up imbalanced, frustrated, disappointed with myself.  and after some meditation, some stillness in the sunshine - i realized something.  sometimes the work is just to keep going, to muddle through despite all odds.  other times, it is to totally pull back, protect, be still.  but these days i am learning to trust - in others, the process, and in myself.... i am learning to trust in the beautiful, wild, intense structure i’ve built to hold me.. and to trust that i already own everything i need. #owningit #ownership #mindfullness #mindfulnessmeditation #npr #metoo #nomore #moveon #yogisofinstagram #yogilife #artistsoninstagram #artistslife #followthrough #cleareyesfullheartscantlose #westvillage #uppergreenwoodlake #warwickny #monroe #hudsonvalley #teachersofinstagram #prana #ayurvedalife
